import React from 'react';

export default function Headeruser() {
  return (
    <div className="relative bg-lightBlue-600 md:pt-32 pb-32 pt-12 flex items-center justify-center">
      <img
        src="/assets/img/PHOTO-21.jpg" // Assure-toi que ton image est dans public/assets/img/
        alt="Header"
        className="h-full w-full object-cover"
      />
    </div>
  );
}
